message:
Podemos concluir até agora :

- Cerca de 3 à 4 milhões de votos de Bolsonaro foram transferidos para Lula;
- Bolsonaro venceu o segundo turno com 51% dos votos;
- Bolsonaro recebeu mais de 60 milhões de votos no segundo turno;
- TSE e Meta (Dona do Facebook, Instagram e Whatsapp) trabalharam juntos para esconder, silenciar e censurar qualquer dado que se oponha à decisão final do TSE;
- A comunidade cientifica de T.I internacional concorda que existem problemas enormes nos gráficos de votos do TSE;
- Não há contra argumentos contra as provas de fraude eleitoral.
